import React from "react";
import Header from "./components/Header";

function App() {
  return (
    <div className="App">
      <Header/>
      <main className = "container mx-auto p-8">
        <h2 className = "text-3xl font-bold">AI Interview App</h2>
      </main>
    </div>
  );
};

export default App;
